import { Categories } from "../categories/Categories";
import { Carousel } from "./Carousel";
import { Category } from "../category/Category";

export const Home = () => {
  return (
    <>
      <Carousel />
      <Categories />
      <h1 style={{ textAlign: "center" }}>Featured Categories</h1>
      <Category category="essentials" />
    </>
  );
};
